import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../api';

const Dashboard = ({ handleLogout }) => {
    const [userData, setUserData] = useState(null);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    // XP thresholds for each rank
    const RANKS = [
        { name: "White Belt", xp: 0 },
        { name: "Yellow Belt", xp: 20 },
        { name: "Orange Belt", xp: 40 },
        { name: "Green Belt", xp: 70 },
        { name: "Blue Belt", xp: 100 },
        { name: "Purple Belt", xp: 140 },
        { name: "Brown Belt", xp: 190 },
        { name: "Black Belt", xp: 250 }
    ];

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await API.get('/api/user');
                setUserData(response.data);
                setError('');
            } catch (err) {
                if (err.response?.status === 401) {
                    handleLogout();
                    navigate('/login');
                } else {
                    setError('Failed to load user data');
                }
            } finally {
                setIsLoading(false);
            }
        };

        fetchUserData();
    }, [handleLogout, navigate]);

    const getCurrentRank = (xp) => {
        let rank = RANKS[0];
        for (let i = RANKS.length - 1; i >= 0; i--) {
            if (xp >= RANKS[i].xp) {
                rank = RANKS[i];
                break;
            }
        }
        return rank;
    };

    const getNextRank = (currentRank) => {
        const currentIndex = RANKS.findIndex(r => r.name === currentRank.name);
        if (currentIndex < RANKS.length - 1) {
            return RANKS[currentIndex + 1];
        }
        return null;
    };

    if (isLoading) {
        return (
            <div className="dashboard-container">
                <p>Loading dashboard...</p>
            </div>
        );
    }

    if (error) {
        return (
            <div className="dashboard-container">
                <p className="error-message">{error}</p>
            </div>
        );
    }

    if (!userData) {
        return (
            <div className="dashboard-container">
                <p>No user data available</p>
            </div>
        );
    }

    const currentRank = getCurrentRank(userData.xp);
    const nextRank = getNextRank(currentRank);
    const xpToNextRank = nextRank ? nextRank.xp - userData.xp : 0;
    const completionPercentage = nextRank
        ? Math.min(100, Math.round((userData.xp - currentRank.xp) / (nextRank.xp - currentRank.xp) * 100))
        : 100;

    return (
        <div className="dashboard-container">
            {/* Header */}
            <header className="dashboard-header">
                <h1>Welcome to CodeDojo, <strong>{userData.username}</strong></h1>
            </header>

            {/* Main Dashboard Content */}
            <div className="dashboard-content">
                <div className="dashboard-card">
                    <h2>Profile</h2>
                    <p>Username: <strong>{userData.username}</strong></p>
                    <p>Email: <strong>{userData.email}</strong></p>
                </div>

                <div className="dashboard-card">
                    <h2>Progress</h2>
                    <p>Total XP: <strong>{userData.xp}</strong></p>
                    <p>Current Rank: <strong>{currentRank.name}</strong></p>

                    {nextRank && (
                        <>
                            <div className="progress-container">
                                <div className="progress-bar" style={{ width: `${completionPercentage}%` }}></div>
                            </div>
                            <p>
                                {xpToNextRank} XP needed for {nextRank.name}
                            </p>
                        </>
                    )}
                </div>

                <div className="dashboard-card">
                    <h2>Challenges</h2>
                    <p>Completed: <strong>{userData.completed_challenges?.length || 0}/15</strong></p>
                    <p>Remaining: <strong>{15 - (userData.completed_challenges?.length || 0)}</strong></p>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
